import React from 'react'



function App() {
    let tasks = ["1", "2", "3"]
    return (
        <div className="task-list">
            {tasks.map(task => (
                <div className="task">
                    <input type="checkbox" /> 
                    <p>Task {task}</p>
                </div>
            ))}
        </div>
    )
}

export default App;
